package main

import (
	"testing"
)

func TestFirst(t *testing.T) {
	input := "croakcroak"

	expected := 1
	given := minNumberOfFrogs(input)

	if given != expected {
		t.Errorf("%d given but %d expected for %s", given, expected, input)
	}
}

